import SearchForm from '../components/SearchForm';
import MovieList from '../components/movies/MovieList';

function SearchPage() {
    const movies = [
      {
        "name": "Biutiful",
        "category": "Actor -- Leading Role",
        "additionInfo": "Biutiful {'Uxbal'}",
        "won": "NO"
      },
      {
          "name": "True Grit",
          "category": "Actor -- Leading Role",
          "additionInfo": "True Grit {'Rooster Cogburn'}",
          "won": "NO"
      },
      {
          "name": "The Social Network",
          "category": "Actor -- Leading Role",
          "additionInfo": "The Social Network {'Mark Zuckerberg'}",
          "won": "NO"
      },
      {
          "name": "The King's Speech",
          "category": "Actor -- Leading Role",
          "additionInfo": "The King's Speech {'King George VI'}",
          "won": "YES"
      },
      {
          "name": "127 Hours",
          "category": "Actor -- Leading Role",
          "additionInfo": "127 Hours {'Aron Ralston'}",
          "won": "NO"
      },
        // Add more job objects as needed
    ];

    return (    
        <div className="container">
            {/* First column */}
            <div className='row'>
            <div className="col-sm-3">
                <SearchForm/>
            </div>
            {/* Second column */}
            <div className="col-sm-9 mt-4 px-1">
                <MovieList movies={movies} />
            </div>
            </div>
        </div>
    );
};

export default SearchPage;
